<!DOCTYPE html>
<html lang="en-US">
<head>
<meta charset="utf-8" >
<base href="//highfivediet.com" />
<title>Fell In Love with a Girl</title>
<style>
svg {
  background-image: url('/svg/grid-fine-2.svg');
}
</style>

<script>
class Logger {
    on = false;
    constructor (on) {
        this.on = on?on:false;
        return this;
    }
    Notice(msg) {
        this.Dispatch("Notice",msg);
    }
    Debug(msg) {
        this.Dispatch("Notice",msg);
    }
    Warning(msg) {
        this.Dispatch("Notice",msg);
    }
    Remove() {
        this.on = false;
    }
    Hide() {
        this.on = false;
    }
    Dispatch(level, msg) {
        if (this.on) {
            console.log(level + ": " + msg);
        }
    }
}

var Log = new Logger(true);

window.addEventListener('DOMContentLoaded', () => {
    Log.Notice("Removing Logging");
    Log.Remove();
});

</script>

</head>

<div id="svg-container">
<svg
    id="fell-in-love-with-a-girl-song"
    xmlns:svg="http://www.w3.org/2000/svg"

    xmlns:xlink="http://www.w3.org/1999/xlink"

    height="1200"
    viewBox="0 0 1000 1200"

<defs>

<radialGradient color-interpolation="sRGB" id="FishEye" spreadMethod="pad" cx="20%" cy="20%">
<animate attributeName="cx" values="0%;20%;100%;80%;0%" begin="0s" dur="15s" repeatCount="indefinite" />
<animate attributeName="cy" values="0%;100%;100%;80%;0%" begin="0s" dur="15s" repeatCount="indefinite" />
  <stop stop-color="green" offset="0%" />
  <stop stop-color="red" offset="50%" />
  <stop stop-color="green" offset="75%" />
</radialGradient>

<rect id="FishEyeRect" x="10" y="130" height="400" width="700" style="fill: url(#FishEye); stroke: none;" />

<filter id="girl-song">

<feColorMatrix type="saturate" values="0.0" />
  <feComponentTransfer color-interpolation-filters="sRGB">
    <feFuncR type="discrete" tableValues="0.137255 0.760784 0 1 1.000000 1" />
    <feFuncG type="discrete" tableValues="0.454902 0.058824 0 1 0.866667 1" />
    <feFuncB type="discrete" tableValues="0.776471 0.000000 0 1 0.133333 1" />
  </feComponentTransfer>
</filter>

<filter id="girl-song-vary" x="110%" width="120%" filterUnits="userSpaceOnUse" color-interpolation="sRGB">

  <animate attributeName="x" values="110%;-10%;-10%;110%" begin="0s" dur="45s" repeatCount="indefinite" />
  <feColorMatrix type="saturate" values="0.0" />
    <feComponentTransfer color-interpolation-filters="sRGB">
      <feFuncR type="discrete" tableValues="0.137255 0.760784 0 1 1.000000 1" />
      <feFuncG type="discrete" tableValues="0.454902 0.058824 0 1 0.866667 1" />
      <feFuncB type="discrete" tableValues="0.776471 0.000000 0 1 0.133333 1" />
    </feComponentTransfer>
  </filter>
  
<filter id="girl-song-2">

<feColorMatrix type="saturate" values="0.0" />
<feComponentTransfer color-interpolation-filters="sRGB">
  <feFuncR type="discrete" tableValues="0.137255 0.760784 0  1 1.000000" />
  <feFuncG type="discrete" tableValues="0.454902 0.058824 0  1 0.866667" />
  <feFuncB type="discrete" tableValues="0.776471 0.000000 0  1 0.133333" />
</feComponentTransfer>
</filter>

<filter id="girl-song-vary-2" x="110%" width="120%" filterUnits="userSpaceOnUse"
        color-interpolation="sRGB">

  <animate attributeName="x" values="110%;-10%;-10%;110%" begin="0s" dur="45s"
          repeatCount="indefinite" />

  <feFlood id="floodBG" flood-color="rgba(0,0,0,0.1)" in="SourceGraphic" result="red-bg" />

  <feColorMatrix type="saturate" values="0.0" in="SourceGraphic" result="greyScale" />

  <feComponentTransfer color-interpolation-filters="sRGB" result="discreteColors" in="greyScale">
    <feFuncR type="discrete" tableValues="0.137255 0.760784 0 1 1.000000 1" />
    <feFuncG type="discrete" tableValues="0.454902 0.058824 0 1 0.866667 1" />
    <feFuncB type="discrete" tableValues="0.776471 0.000000 0 1 0.133333 1" />
    <feFuncA type="discrete" tableValues="1        1        0 1 1        1" />
  </feComponentTransfer>

  <feMorphology operator="erode" radius="1" in="discreteColors" result="erode">
      <animate attributeName="radius" values="1;4;3;1"
      dur="20s" begin="0s" repeatCount="indefinite" />
  </feMorphology>

  <feComposite in="red-bg" in2="erode" operator="atop" />
</filter>
    
<filter id="girl-song-2">

<feColorMatrix type="saturate" values="0.0" />
  <feComponentTransfer color-interpolation-filters="sRGB">
    <feFuncR type="discrete" tableValues="0.137255 0.760784 0  1 1.000000" />
    <feFuncG type="discrete" tableValues="0.454902 0.058824 0  1 0.866667" />
    <feFuncB type="discrete" tableValues="0.776471 0.000000 0  1 0.133333" />
  </feComponentTransfer>
</filter>

<filter id="girl-song-flag">

<feColorMatrix type="saturate" values="0.0" /> 
  <feComponentTransfer color-interpolation-filters="sRGB">

   <!-- Build a Pen using these colors from the "Fell in Love with a Girl" by the White Stripes:
     #2374C6, #C20F00, #FFDD22, #FFFFFF, and #000000.

                                #FFDD22 ----------------------------v          v
                                #C20F00 --------------v  Black--v   v  Black-v v
                                White --------------v v         v   v        v v
                                #2374C6---v         v v         v   v        v v                  
    <feFuncR type="discrete" tableValues="0.137255  1 0.760784  0 1 1.000000 0 1 " />
    <feFuncG type="discrete" tableValues="0.454902  1 0.058824  0 1 0.866667 0 1 " />
    <feFuncB type="discrete" tableValues="0.776471  1 0.000000  0 1 0.133333 0 1 " /> -->

    <feFuncR type="discrete" tableValues="0.137255 0.760784 1 0 1.000000" />
    <feFuncG type="discrete" tableValues="0.454902 0.058824 1 0 0.866667" />
    <feFuncB type="discrete" tableValues="0.776471 0.000000 1 0 0.133333" />

  </feComponentTransfer>

</filter>
